import{o as a,c as s,a as e}from"./app.8e4620e7.js";const n='{"title":"Programmeerimine I","description":"","frontmatter":{},"headers":[{"level":2,"title":"Tund 02","slug":"tund-02"},{"level":3,"title":"Eesmärk – selle raamatu abil natsa progemisele üldiselt pita saada.","slug":"eesmark-–-selle-raamatu-abil-natsa-progemisele-uldiselt-pita-saada"},{"level":2,"title":"Sõnastik","slug":"sonastik"},{"level":3,"title":"B","slug":"b"},{"level":3,"title":"E","slug":"e"},{"level":3,"title":"M","slug":"m"},{"level":3,"title":"O","slug":"o"},{"level":3,"title":"N","slug":"n"},{"level":3,"title":"S","slug":"s"},{"level":3,"title":"neljapäevased küsimused:","slug":"neljapaevased-kusimused"}],"relativePath":"prog/index.md","lastUpdated":1618769788512}',t={},i=e('<h1 id="programmeerimine-i"><a class="header-anchor" href="#programmeerimine-i" aria-hidden="true">#</a> Programmeerimine I</h1><p>“It is important to note that JavaScript has almost nothing to do with the programming language named Java. The similar name was inspired by marketing considerations rather than good judgment. When JavaScript was being introduced, the Java language was being heavily marketed and was gaining popularity. Someone thought it was a good idea to try to ride along on this success. Now we are stuck with the name.”</p><p>Excerpt From: Marijn Haverbeke. “Eloquent JavaScript”. Apple Books.</p><h2 id="tund-02"><a class="header-anchor" href="#tund-02" aria-hidden="true">#</a> Tund 02</h2><p>Kodutöö – leida ajaarvestus programm ja lugeda ning &quot;träkkida&quot; lugemiseaega.<br> Lugemismaterjal: <a href="https://eloquentjavascript.net" target="_blank" rel="noopener noreferrer">https://eloquentjavascript.net</a><br> Träkkimissoft: <a href="https://zapier.com/blog/best-time-tracking-apps/" target="_blank" rel="noopener noreferrer">https://zapier.com/blog/best-time-tracking-apps/</a></p><p>Otsisin sellist, mis olesk unibversaalme – telefonis ja desktopis<br> Toggl vist Eesti oma?<br> Avastasin, et olen Togglit kunagi juba ka kasutanud.</p><h3 id="eesmark-–-selle-raamatu-abil-natsa-progemisele-uldiselt-pita-saada"><a class="header-anchor" href="#eesmark-–-selle-raamatu-abil-natsa-progemisele-uldiselt-pita-saada" aria-hidden="true">#</a> Eesmärk – selle raamatu abil natsa progemisele üldiselt pita saada.</h3><p>Nii nagu sissejuhatus lubas.<br> Teiseks, saada ülevaade ka Javascriptist.<br> Kolmandaks, testida Toggk nimelist ajaarvestajat.</p><p><strong>Raamat soovitab – kui läheb keeruliseks, ära löö käega – tee parem vahe, loe varasemad kohad uuesti üle. See on igatepidi ok, kui asi tundub raske.</strong></p><p>Lugedes kasutasin koodide testimiseks ja harjutamiseks <a href="https://playcode.io/new/" target="_blank" rel="noopener noreferrer">playcode&#39;i</a></p><p>Ajaarvestuses on probleemiks unustamine – sisselülitamise unustamine ja väljalülitamise unustamine (oma tavaasjades aitab vigu siluda mailisaatmine või kõne kliendiga, need on träkitavad)</p><h2 id="sonastik"><a class="header-anchor" href="#sonastik" aria-hidden="true">#</a> Sõnastik</h2><p>+= - see on nagu selline asi, et kui tahan asjale endale midagi liita, ehk asja väärtust liidetavaga tsüklis suurendada<br> , – muutujaid saab koma abil deklareerida korraga mitu. Nt:</p><div class="language-javascript"><pre><code><span class="token keyword">let</span> x <span class="token operator">=</span> <span class="token number">5</span><span class="token punctuation">,</span>\n  y <span class="token operator">=</span> <span class="token number">4</span><span class="token punctuation">,</span>\n  z <span class="token operator">=</span> <span class="token string">&quot;sinine&quot;</span><span class="token punctuation">;</span>\n</code></pre></div><p>= vs == vs === kaks võrdust lubab võrduma panna eri tüübid nt <code>5 == &quot;5&quot;</code> kolm võrdust käsib/lubab võrduma panna ainult ja ainult sama tüüpi asjad. Nt <code>5 = 5</code></p><p>And/Ja – &amp;&amp;<br> Või/or - ||</p><h3 id="b"><a class="header-anchor" href="#b" aria-hidden="true">#</a> B</h3><ul><li>Boolean/tõeväärtus – jah ei, true false.<div class="language-javascript"><pre><code>console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token number">3</span> <span class="token operator">&gt;</span> <span class="token number">2</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token comment">// → true</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token number">3</span> <span class="token operator">&lt;</span> <span class="token number">2</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token comment">// → false</span>\n</code></pre></div>või<div class="language-javascript"><pre><code>console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">&quot;Aardvark&quot;</span> <span class="token operator">&lt;</span> <span class="token string">&quot;Zoroaster&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token comment">// → true</span>\n</code></pre></div><strong>NB! Suurtähed on väiksemad kui väiketähed</strong></li></ul><h3 id="e"><a class="header-anchor" href="#e" aria-hidden="true">#</a> E</h3><ul><li>Empty value – null and undefined</li></ul><h3 id="m"><a class="header-anchor" href="#m" aria-hidden="true">#</a> M</h3><ul><li>Muutujad – let, var, const let – so kõige tavalisem muutuja. Let on skoobipõhine, väljaspool võib samanimelise let&#39;i uuesti defineerida. var - vanas stiilis muutuja. Var on universaalne, mõjub ka skoobist väljaspool. const - pmst konstant. täpsemalt muutuja, mida saab muuta vaid ühes kohas, st mitu korda sama consti kasutada ei saa.<br> typeof – annab muutuja tüübi <code>console.log(typeof 4.5)//number</code></li></ul><h3 id="o"><a class="header-anchor" href="#o" aria-hidden="true">#</a> O</h3><ul><li>Operaator – tehtemärgid <code>* - +</code> jne % on jäägi leidmise operaator<br> typeof – annab muutuja tüübi <code>console.log(typeof 4.5)//number</code></li></ul><h3 id="n"><a class="header-anchor" href="#n" aria-hidden="true">#</a> N</h3><ul><li>Numbrid Nan – not a number, on numbru tüüp Infinity</li></ul><h3 id="s"><a class="header-anchor" href="#s" aria-hidden="true">#</a> S</h3><ul><li><p>Stringid – võivad olla nii jutumärkides, üleakomades kui backtickides</p><div class="language-javascript"><pre><code><span class="token template-string"><span class="token template-punctuation string">`</span><span class="token string">Down on the sea</span><span class="token template-punctuation string">`</span></span><span class="token punctuation">;</span>\n<span class="token punctuation">(</span><span class="token string">&quot;Lie on the ocean&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">(</span><span class="token string">&quot;Float on the ocean&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre></div><p>Kui vaja, kasuta tagurpidi kaldkriipsu/backslash. So escape&#39;imine. Tähtedel pärast backslashi on mingi eritähendus, nt \\n tähendab reavahetust. Kaks tagurpidi kalkriipsu muutuvad üheks.</p><div class="language-javascript"><pre><code><span class="token string">&quot;A newline character is written like \\&quot;\\\\n\\&quot;.&quot;</span><span class="token punctuation">;</span>\n\n</code></pre></div><p>Arvutamine lause sees – <code>${siia sisse tehe}</code><br> nt:</p><div class="language-javascript"><pre><code><span class="token template-string"><span class="token template-punctuation string">`</span><span class="token string">half of 100 is </span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span><span class="token number">100</span> <span class="token operator">/</span> <span class="token number">2</span><span class="token interpolation-punctuation punctuation">}</span></span><span class="token template-punctuation string">`</span></span><span class="token punctuation">;</span>\n</code></pre></div><p>Tulemuseks <code>half of 100 is 50</code></p></li></ul><h3 id="neljapaevased-kusimused"><a class="header-anchor" href="#neljapaevased-kusimused" aria-hidden="true">#</a> neljapäevased küsimused:</h3><p>The last logical operator I will discuss is not unary, not binary, but ternary, operating on three values. It is written with a question mark and a colon, like this:</p><p>console.log(true ? 1 : 2);</p><p>// → 1</p><p>console.log(false ? 1 : 2);</p><p>// → 2</p>',34);t.render=function(e,n,t,o,l,p){return a(),s("div",null,[i])};export default t;export{n as __pageData};
